import Link from 'next/link';

const linkStyle = {
    marginRight : 15
};
const layoutStyle = {
    marginRight: 20,
    marginLeft: 20,
    padding: 20,
    border: '1px solid #DDD'
  };

const Header = () => (
    <div style={layoutStyle}>
        <Link href="/">
            <a style={linkStyle}>Home</a>
        </Link>
        <Link href="/about">
            <a style={linkStyle}>About</a>
        </Link>
    </div>
);

export default Header;
